import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import authService from "../../services/authService";

const Login = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    email: "",
    password: "",
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await authService.login(form);
      console.log("‚úÖ LOGIN RESULT:", res.data);

      const loginData = res.data;

      // ‚úÖ S·ª¨A: Server tr·∫£ v·ªÅ 'token' ch·ª© kh√¥ng ph·∫£i 'jwt-token'
      const token = loginData.token || loginData['jwt-token'];

      if (!token) {
        console.error("‚ùå No token found in response:", loginData);
        throw new Error("No token received from server");
      }

      console.log("üîê Token received:", token.substring(0, 50) + "...");

      // ‚úÖ L∆ØU TOKEN
      localStorage.setItem("token", token);
      console.log("üíæ Token saved to localStorage");

      // ‚úÖ GI·∫¢I M√É TOKEN ƒê·ªÇ L·∫§Y USER ID
      let realUserId = null;
      let userEmail = form.email;

      try {
        // Gi·∫£i m√£ payload t·ª´ JWT token
        const payload = JSON.parse(atob(token.split('.')[1]));
        console.log("üîì Decoded token payload:", payload);

        // L·∫•y user ID t·ª´ token payload
        realUserId = payload.sub || payload.userId || payload.user_id;
        userEmail = payload.email || userEmail;

        console.log("‚úÖ User ID from token:", realUserId);
        console.log("‚úÖ User email from token:", userEmail);
      } catch (decodeError) {
        console.warn("‚ö†Ô∏è Could not decode token:", decodeError);
      }

      // ‚úÖ TH·ª¨ L·∫§Y USER ID T·ª™ API /auth/me N·∫æU KH√îNG C√ì T·ª™ TOKEN
      if (!realUserId) {
        console.log("üîç No user ID from token, calling /auth/me...");
        try {
          const userInfoResponse = await fetch('http://localhost:8080/api/auth/me', {
            method: 'GET',
            headers: {
              'Authorization': `Bearer ${token}`,
              'Content-Type': 'application/json'
            }
          });

          if (userInfoResponse.ok) {
            const userInfo = await userInfoResponse.json();
            realUserId = userInfo.userId || userInfo.user_id;
            console.log("‚úÖ User ID from /auth/me:", realUserId);
          } else {
            console.warn("‚ö†Ô∏è /auth/me failed, status:", userInfoResponse.status);
          }
        } catch (meError) {
          console.warn("‚ö†Ô∏è /auth/me endpoint error:", meError);
        }
      }

      // ‚úÖ N·∫æU V·∫™N KH√îNG C√ì USER ID, T·∫†O TEMP ID
      if (!realUserId) {
        console.warn("‚ö†Ô∏è No real user ID found, creating temporary ID");
        realUserId = `temp_${Date.now()}`;
      }

      // ‚úÖ L∆ØU USER DATA
      const userToStore = {
        userId: realUserId,
        email: userEmail,
        first_name: loginData.first_name || loginData.firstName || "",
        last_name: loginData.last_name || loginData.lastName || ""
      };

      localStorage.setItem("user", JSON.stringify(userToStore));
      console.log("üíæ User data saved:", userToStore);

      // ‚úÖ KI·ªÇM TRA L·∫†I
      const savedToken = localStorage.getItem("token");
      const savedUser = JSON.parse(localStorage.getItem("user"));

      console.log("üîç FINAL AUTH CHECK:", {
        token: savedToken ? `EXISTS (${savedToken.length} chars)` : "MISSING",
        user: savedUser ? `EXISTS (ID: ${savedUser.userId})` : "MISSING"
      });

      alert("‚úÖ ƒêƒÉng nh·∫≠p th√†nh c√¥ng!");

      // ‚úÖ CHUY·ªÇN TRANG
      setTimeout(() => {
        window.location.href = "/";
      }, 500);

    } catch (err) {
      console.error("‚ùå LOGIN ERROR:", err);
      localStorage.clear();
      alert("‚ùå ƒêƒÉng nh·∫≠p th·∫•t b·∫°i: " + (err.response?.data?.message || err.message));
    }
  };

  return (
    <div className="card mx-auto" style={{ maxWidth: "380px", marginTop: "100px" }}>
      <div className="card-body">
        <h4 className="card-title mb-4">Sign in</h4>

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <input
              name="email"
              className="form-control"
              placeholder="Email"
              type="email"
              value={form.email}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <input
              name="password"
              className="form-control"
              placeholder="Password"
              type="password"
              value={form.password}
              onChange={handleChange}
              required
            />
          </div>

          <button type="submit" className="btn btn-primary btn-block">
            Login
          </button>
        </form>
      </div>
    </div>
  );
};

export default Login;
